import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import PanelTemplate from "./PanelTemplate";

function Details() {
    const { id } = useParams();
    const [product, setProduct] = useState(null);
    const [loading, setLoading] = useState(true);

    const productImages = {
        1: "/images/Swal.png",
        2: "/images/scarf1.png",
        3: "/images/Bonnet1.png",
    };

    useEffect(() => {
        fetch(`http://localhost:5003/product/${id}`)
            .then((res) => {
                if (!res.ok) throw new Error("Sunucu hatasƒ±: " + res.status);
                return res.json();
            })
            .then((data) => {
                console.log("Gelen Veri:", data);
                setProduct(data);
                setLoading(false);
            })
            .catch((err) => {
                console.error("Veri √ßekme hatasƒ±:", err);
                setLoading(false);
            });
    }, [id]);

    if (loading) return <div style={{ padding: "20px" }}>Y√ºkleniyor...</div>;
    if (!product) return <div style={{ padding: "20px" }}>√úr√ºn bulunamadƒ±.</div>;

    return (
        <PanelTemplate
            role="manager"
            rightContent={
                <div style={{ padding: "20px" }}>
                    <h2 style={{ borderBottom: "2px solid #eee", paddingBottom: "10px" }}>
                        √úr√ºn Detay Paneli (Master-Detail)
                    </h2>

                    <div style={{ display: "flex", gap: "40px", marginTop: "20px", flexWrap: "wrap" }}>

                        {/* SOL TARAF: Sabit Boyutlu √úr√ºn G√∂rseli */}
                        <div style={{ flex: "1", minWidth: "300px" }}>
                            <img
                                src={product.image_url && product.image_url !== "/images/default.png"
                                    ? product.image_url
                                    : (productImages[Number(product.category_id)] || "/images/default.png")}
                                alt={`${product.material} ${product.category_name}`}
                                style={{
                                    width: "100%",
                                    height: "450px",         // Sabit Y√ºkseklik
                                    objectFit: "cover",      // Yamulmayƒ± √∂nleyen kƒ±rpma
                                    borderRadius: "15px",
                                    boxShadow: "0 4px 15px rgba(0,0,0,0.1)",
                                    display: "block"
                                }}
                                onError={(e) => { e.target.src = "/images/default.png"; }}
                            />
                        </div>

                        {/* SAƒû TARAF: Veritabanƒ± Detaylarƒ± */}
                        <div style={{ flex: "1", minWidth: "300px" }}>
                            <div style={{ backgroundColor: "#f9f9f9", padding: "25px", borderRadius: "15px", border: "1px solid #eee" }}>
                                <h3 style={{ marginTop: 0, color: "#333" }}>{product.category_name} Teknik Bilgileri</h3>

                                <p><strong>√úr√ºn ID:</strong> #{product.product_id}</p>

                                {/* Dƒ∞NAMƒ∞K ALANLAR: √úr√ºn tipine g√∂re √∂zel bilgiler */}
                                {product.product_type === 'Scarf' && product.size && (
                                    <p><strong>üìê E≈üarp Ebatƒ±:</strong> {product.size}</p>
                                )}
                                {product.product_type === 'Shawl' && product.lengt && (
                                    <p><strong>üìè ≈ûal Uzunluƒüu:</strong> {product.lengt}</p>
                                )}
                                {product.product_type === 'Bonnet' && product.body && (
                                    <p><strong>üë§ Bone Bedeni:</strong> {product.body}</p>
                                )}

                                <p><strong>üßµ Materyal:</strong> {product.material}</p>
                                <p><strong>üé® Renk:</strong> {product.color}</p>
                                <p><strong>üí∞ Fiyat:</strong> <span style={{ color: "#2e7d32", fontSize: "1.3em", fontWeight: "bold" }}>{product.price} TL</span></p>
                                <p><strong>üì¶ Stok Durumu:</strong> {product.quantity} Adet</p>

                                <hr style={{ border: "0.5px solid #ddd", margin: "20px 0" }} />
                                <p style={{ fontSize: "0.85em", color: "#888", fontStyle: "italic" }}>
                                    * Bu teknik ayrƒ±ntƒ±lar <strong>view_product_details</strong> √ºzerinden alt tablolarla (Scarf/Shawl/Bonnet) ili≈ükilendirilerek getirilmi≈ütir.
                                </p>
                            </div>

                            <button style={{
                                marginTop: "20px",
                                width: "100%",
                                padding: "18px",
                                backgroundColor: "#ff9800",
                                color: "white",
                                border: "none",
                                borderRadius: "10px",
                                cursor: "pointer",
                                fontSize: "1.1em",
                                fontWeight: "bold",
                                transition: "0.3s"
                            }}
                                onMouseOver={(e) => e.target.style.backgroundColor = "#e68a00"}
                                onMouseOut={(e) => e.target.style.backgroundColor = "#ff9800"}
                            >
                                üõí Sepete Ekle
                            </button>
                        </div>
                    </div>

                    {/* --- ALT KISIM: TRIGGER TABLOSU (STOK GE√áMƒ∞≈ûƒ∞) --- */}
                    <div style={{ marginTop: "40px" }}>
                        <h3 style={{ color: "#d32f2f" }}>üïí Stok Hareket Ge√ßmi≈üi (Database Trigger)</h3>
                        <table style={{ width: "100%", borderCollapse: "collapse", marginTop: "10px", backgroundColor: "#fff" }}>
                            <thead>
                                <tr style={{ backgroundColor: "#f2f2f2", textAlign: "left" }}>
                                    <th style={{ padding: "12px", border: "1px solid #ddd" }}>ƒ∞≈ülem</th>
                                    <th style={{ padding: "12px", border: "1px solid #ddd" }}>Eski Stok</th>
                                    <th style={{ padding: "12px", border: "1px solid #ddd" }}>Yeni Stok</th>
                                    <th style={{ padding: "12px", border: "1px solid #ddd" }}>Tarih</th>
                                </tr>
                            </thead>
                            <tbody>
                                {product.logs && product.logs.length > 0 ? (
                                    product.logs.map((log, index) => (
                                        <tr key={index}>
                                            <td style={{ padding: "12px", border: "1px solid #ddd" }}>{log.operation_type}</td>
                                            <td style={{ padding: "12px", border: "1px solid #ddd" }}>{log.old_quantity}</td>
                                            <td style={{ padding: "12px", border: "1px solid #ddd", fontWeight: "bold", color: "#1976d2" }}>{log.new_quantity}</td>
                                            <td style={{ padding: "12px", border: "1px solid #ddd" }}>{new Date(log.change_date).toLocaleString()}</td>
                                        </tr>
                                    ))
                                ) : (
                                    <tr>
                                        <td colSpan="4" style={{ padding: "15px", textAlign: "center", color: "#999" }}>Hen√ºz stok hareketi yok.</td>
                                    </tr>
                                )}
                            </tbody>
                        </table>
                    </div>
                </div>
            }
        />
    );
}

export default Details;
